Casino-eigenaar Willie Bank staat op het punt om in Las Vegas een groot casino/ hotel te openen. Maar als Bank dan Reuben Tishkoff belazert en Reuben hierdoor met hartproblemen in het ziekenhuis komt te liggen, besluiten Danny Ocean en de rest van de bende om wraak op Bank te nemen. Ze besluiten om er voor te zorgen dat de opening van Bank's casino uitloopt tot een grote ramp, zodat Bank veel geld zal verliezen. En daarnaast probeert de groep ook nog om de kostbare en tevens zwaarbewaakte diamanten, die Bank heeft gewonnen met zijn vorige hotels, te stelen.:
